import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance", amount: 54.22, date: new Date(2022, 0, 5) },
    { title: "Netflix", amount: 12.99, date: new Date(2022, 0, 9) },
    { title: "Gym", amount: 84, date: new Date(2022, 0, 7) },
    { title: "Toothpaste", amount: 5, date: new Date(2022, 0, 12) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      />
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}
      ></ExpenseItem>
      <div></div>
    </div>
  );
}

export default App;
